% this script attempts to find the channel destortions on the sync
% sequence, from a real world recording
clear;
clc;
%% constants
carrier_freq = 10e3;
rs_uncoded_block_size_bits = 512;
modulation_order = 4;
symbol_rate = 4096;
sample_rate = 40960;
modulaiton_index = 1;
bits_per_symbol = log2(modulation_order);
bit_rate = log2(modulation_order)*symbol_rate;
samples_per_symbol = sample_rate/symbol_rate;
delta_f = modulaiton_index*symbol_rate;
spectral_bandwidth = delta_f*modulation_order;
sampling_bandwidth = sample_rate/2;
fft_bin_size = sampling_bandwidth/samples_per_symbol; % assuming fft test for each symbol
buffer_size = 8192;
buffer_step_size = 1024;
rs_m = 8;      % Number of bits per symbol
rs_n = 128;    % Codeword length (in gf symbols). max = 2^m - 1, set to 128 for ratio of 0.5
rs_k = 64;     % Message length (in gf symbols)
rs_coding_rate = rs_k/rs_n;


%% load recording
load('C:\ToDATA\acoustic lock project\matlab\matlab code\audio recordings\echo_test_tx_signal.mat')
[raw_rx_sig, rx_sample_freq] = audioread("echo_signal_rec_1_high_snr.wav");
raw_rx_sig = raw_rx_sig(:,1); % use one channel
rx_signal = resample(raw_rx_sig,sample_rate,rx_sample_freq);
%% for baseband debug
t = (0:length(rx_signal)-1)/sample_rate;
shifted_rx_signal = rx_signal.*exp(-2*pi*1j*(carrier_freq*t)).';
baseband_rx_signal = 2.*lowpass(shifted_rx_signal, (spectral_bandwidth/2) ,sample_rate);
% agc_baseband_rx_signal = agc(baseband_rx_signal);
gain_baseband_rx_signal = baseband_rx_signal.*10;
padded_baseband_rx_signal = [gain_baseband_rx_signal; zeros(buffer_step_size - mod(length(baseband_rx_signal),buffer_step_size),1)];% pad to length
processed_rx_signal = padded_baseband_rx_signal;
baseband_sig_matrix = reshape(padded_baseband_rx_signal,1024,[]);
